import React,{Component} from 'react';
import {Table} from 'reactstrap';

export default class SharedTable extends Component{

	render(){
		console.log(this.props)
		const header=this.props.header.map((k)=>{
			return(
				<th>{k}</th>
			)
		});

		const parsedData=this.props.dataValue.map((k,i)=> {
			return(
				<tr>
					{this.props.tdValues.map((e)=> {
						{if(e==='isFlying' && e==='isGround'){
							return <span>{(k.isGround && k.isFlying) ? '<td>Yes</td><td>Yes</td>' : k.isGround ? '<td>No</td><td>Yes</td>' : k.isFlying ? '<td>Yes</td><td>No</td>' : 'None'}</span>
						}else{
							return<td>{k[e]}</td>
						}}
					})}
				</tr>
			)
		});
		console.log(parsedData);

		return(	
			<Table>
				<thead>
					{header}
				</thead>
				<tbody>
					{parsedData}
				</tbody>
			</Table>
		)
	}
}
